import { Component } from 'react';
import { WebmapData } from '../../data/webmapData';

export default class webmapList extends Component {
    state = {
        webmap:WebmapData
    }

  render() {
    let {webmap} = this.state;

    console.log(this.propos);

    return (
        <div className="content">
          <div className="experiences">
              {
                webmap.map(item => {
                  return(
                      <webmap
                        key={item.id}
                        item={item.page}
                      />
                  )
                })
              }
            </div>
        </div>
    )
  }
}
